From her first dance lesson at 3 to her first dance teaching job at 16, Miss Sheena MissDemeanour’s passion for dance has never wavered.  A day after she turned 18, Sheena waved goodbye to her singer & dancer dad and found herself on a flight to LA, returning home some 6 months later totally in love with jazz music & dance scene, having found her tribe at the New Orleans Jazz Festival. Sheena started teaching dance from 16 and taught pole dancing for 12 years. After many years in a 9 - 5 job, her love for dancing and the pull was too strong to ignore. 

After being made redundant around 33, she saw the opportunity to reinvent herself. She was hooked after attending a burlesque show. Consumed & enamoured with the dance, the community & a discipline where women of all shapes & sizes could perform in a safe space without judgement. The friendships made, the support & outpouring of love she has received from the community has been phenomenal. A proud 48 year old dancer, dance teacher, studio owner, lover, step-mum, friend & cancer survivor. Sheena’s worked her whole life to get to this point, finding joy seeing how she can make other people happy through dance - “no need to be perfect but just experience dance in their own special  way.” What’s next? Sheena tells me one day, she would like to write a show about her life, her career, cancer & all. A stage production to tell her own unique story. A positive story about cancer as she considers herself one very lucky lady. 

